def gcd(m, n):    while 1:        r = m % n        if r == 0:            return n        m, n = n, rN, n, m, p = (int(i) for i in input().split())A = [0]A.append(p)for i in range(1, N):    A.append((A[i - 1] + 153) % p)sum = 0for i in range(1, n + 1):    for j in range(i, m + 1):        if i == j:            sum += A[gcd(i, j)]        else:            sum += A[gcd(i, j)] * 2print(sum)